import React, { useState } from 'react';

import Head from 'next/head';
import Meta from '../Meta';

import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import AccountCircle from '@material-ui/core/icons/AccountCircle';

import { Container, Content960px, MenuWeb, MenuMobile, MenuItem } from './styles';

const Header: React.FC = () => {

  const [activeItem, setActiveItem] = useState('inicial');

  function handleItemClick(page: string) {
    alert(page);
    setActiveItem(page);
  }

  return (
    <>
      <Head>
        <title>Prazer, Cuby!</title>
        <Meta />
      </Head>
      <Container>
        <Content960px>
            <img src="/assets/images/logo_web.svg" onClick={() => handleItemClick('inicio')} />
            <MenuWeb>
              <MenuItem>início</MenuItem>
              <MenuItem>blog</MenuItem>
              <MenuItem>portfólio</MenuItem>
              <MenuItem>serviços</MenuItem>
              <MenuItem>preços</MenuItem>
              <MenuItem>contato</MenuItem>
              <Grid container spacing={1} alignItems="flex-end">
                <Grid item>
                  <AccountCircle />
                </Grid>
                <Grid item>
                  <TextField id="input-with-icon-grid" label="With a grid" />
                </Grid>
              </Grid>
            </MenuWeb>
            <MenuMobile></MenuMobile> 
        </Content960px>
      </Container> 
    </>
  );
}

export default Header;
